import React, {Component} from 'react';
import Header from './components/Header';
import Project from './components/Projects';
import Footer from './components/Footer';
import logo from './imgs/dogbread.png';

class App extends Component {
  state = {
      navigation:[
      {
        id: 1,
        name: 'header',
        links: {
          projects: '#projects',
          art: '/art',
          about: '/about',
          contact: '/contact',
        }
      },
      {
        id:2,
        name: 'art',
        links: {
          illustration: '/illustration',
          grapDesign: '/graphicdesign',
          shop: 'https://ichee.bigcartel.com/',
          contact: '/contact',
        }
      }
    ],
    projects : [
      { projName: 'NookNet', year: '2020', links:[ {name:'NookNet site', linkout:'https://nooknet.net/'} ], description: 'An Animal Crossing guide for new players and old to come here to save collections, make tunes and more. HTML, CSS3, JS, Jquery, CSS Grids, PHP, Symphony, Composer' },
      { projName: 'Classic Vacations', year: '2019-cont.', links:[ { name: 'Style Guide site', linkout:'http://classicvacationsdesign.com/' }, {name: 'Classic Vacations site', linkout: 'https://www.classicvacations.com/'} ], description: 'Created a style guide with the UX designer to help the rest of the team keep a uniformity for the new website look. Used HTML, CSS3, JS, PHP'}
    ]
  }
  render() {
    return (
      <div className="App">
        <Header navigation={this.state.navigation}/>
        <section className = "main-container">
          <div className="inner-box">
            <div className="circle-1">
              <svg className="rotating"  viewBox="0 0 100 100" height="50px" width="50px" stroke-dasharray="10,10">
                <circle cx="50" cy="50" r="100" stroke="white" stroke-width="3" fill="none" />
              </svg>
            </div>
            <h3>hi, my name's <span className="underline-hover">Cecilia Tran</span></h3>
            <div className="about">
                <p>A <span className="">full stack</span> (specializing in front-end dev) and <span>UI/UX designer</span> hybrid at heart. </p>
                <p>Currently a Web Developer working at Expedia.
- Using ReactJS, Drupal, HTML, CSS3, Javascript, PHP, Docker, Photoshop, Illustrator
- Focusing on web/mobile responsive app development and product design.
- Open to freelancing, coding, gaming, photography, drawing, and designing new ideas.</p>
            </div>
          </div>
        </section>
        <Project projects={this.state.projects}/>
        <Footer />
      </div>
    );
  }
}

export default App;
